			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "#!/bin/bash\nset -e\n\n# Detect environment: Xcode Cloud vs Local Xcode\nif [ -d \"/Volumes/workspace/repository\" ]; then\n    REPO_ROOT=\"/Volumes/workspace/repository\"\n    IS_XCODE_CLOUD=true\n    echo \"Xcode Cloud detected\"\nelse\n    REPO_ROOT=\"${SRCROOT}/../..\"\n    REPO_ROOT=\"$(cd \"$REPO_ROOT\" && pwd)\"\n    IS_XCODE_CLOUD=false\n    echo \"Local Xcode detected\"\nfi\n\nIOS_DIR=\"$REPO_ROOT/ios/App\"\nPUBLIC_DIR=\"$IOS_DIR/App/public\"\necho \"Repository root: $REPO_ROOT\"\n\nexport PATH=\"/usr/local/bin:/opt/homebrew/bin:$PATH\"\nNODE_BIN=$(which node || echo \"/usr/local/bin/node\")\nNPM_BIN=$(which npm || echo \"/usr/local/bin/npm\")\n\nif [[ ! -x \"$NODE_BIN\" ]] || [[ ! -x \"$NPM_BIN\" ]]; then\n    echo \"Installing Node via Homebrew...\"\n    export HOMEBREW_NO_INSTALL_CLEANUP=1\n    brew install node >/dev/null 2>&1 || true\n    export PATH=\"/opt/homebrew/bin:/usr/local/bin:$PATH\"\n    NODE_BIN=$(which node || echo \"/opt/homebrew/bin/node\")\n    NPM_BIN=$(which npm || echo \"/opt/homebrew/bin/npm\")\nfi\n\necho \"Using Node: $NODE_BIN\"\necho \"Using NPM: $NPM_BIN\"\n\nif [ ! -f \"$REPO_ROOT/package.json\" ]; then\n    echo \"error: Cannot find package.json\" >&2\n    exit 1\nfi\n\ncd \"$REPO_ROOT\"\n\"$NPM_BIN\" ci --legacy-peer-deps || \"$NPM_BIN\" install --legacy-peer-deps\n\"$NPM_BIN\" run build || { echo \"Build failed\"; exit 1; }\nls -la dist/index.html || { echo \"NO dist/index.html\"; exit 1; }\n\nif [ \"$IS_XCODE_CLOUD\" = true ]; then\n    echo \"Xcode Cloud: Manual copy to avoid sandbox EPERM...\"\n    \n    # Clean public dir contents only (not the dir itself - causes EPERM)\n    if [ -d \"$PUBLIC_DIR\" ]; then\n        rm -rf \"$PUBLIC_DIR\"/* 2>/dev/null || find \"$PUBLIC_DIR\" -mindepth 1 -delete 2>/dev/null || true\n    else\n        mkdir -p \"$PUBLIC_DIR\"\n    fi\n    \n    # Copy web assets\n    cp -R \"$REPO_ROOT/dist/\"* \"$PUBLIC_DIR/\" || { echo \"ERROR: copy failed\"; exit 1; }\n    \n    # capacitor.config.json - use existing or generate from TS\n    if [ ! -f \"$IOS_DIR/App/capacitor.config.json\" ]; then\n        if [ -f \"$REPO_ROOT/capacitor.config.json\" ]; then\n            cp \"$REPO_ROOT/capacitor.config.json\" \"$IOS_DIR/App/capacitor.config.json\"\n        else\n            # Generate JSON from TS config using Node\n            \"$NODE_BIN\" -e \"\n                const ts = require('typescript');\n                const fs = require('fs');\n                const configPath = '$REPO_ROOT/capacitor.config.ts';\n                const source = fs.readFileSync(configPath, 'utf8');\n                const result = ts.transpileModule(source, { compilerOptions: { module: ts.ModuleKind.CommonJS }});\n                const tempFile = '/tmp/cap-config-temp.js';\n                fs.writeFileSync(tempFile, result.outputText);\n                const config = require(tempFile).default;\n                fs.writeFileSync('$IOS_DIR/App/capacitor.config.json', JSON.stringify(config, null, 2));\n            \" 2>/dev/null || echo '{\"appId\":\"com.athletica.sports\",\"appName\":\"Athletica\",\"webDir\":\"dist\"}' > \"$IOS_DIR/App/capacitor.config.json\"\n        fi\n    fi\n    \n    # config.xml - keep existing or create minimal\n    if [ ! -f \"$IOS_DIR/App/config.xml\" ]; then\n        echo '<?xml version=\"1.0\" encoding=\"UTF-8\"?><widget version=\"1.0.0\" xmlns=\"http://www.w3.org/ns/widgets\"><name>App</name></widget>' > \"$IOS_DIR/App/config.xml\"\n    fi\n    \n    echo \"Web assets copied successfully\"\nelse\n    echo \"Local: Running cap sync...\"\n    \"$NODE_BIN\" \"$REPO_ROOT/node_modules/.bin/cap\" sync ios || {\n        echo \"Cap sync failed, manual copy...\"\n        rm -rf \"$PUBLIC_DIR\"/*\n        cp -R \"$REPO_ROOT/dist/\"* \"$PUBLIC_DIR/\"\n    }\nfi\n\n# Verify files\n[ -f \"$IOS_DIR/App/config.xml\" ] || { echo \"ERROR: config.xml not found\"; exit 1; }\n[ -f \"$IOS_DIR/App/capacitor.config.json\" ] || { echo \"ERROR: capacitor.config.json not found\"; exit 1; }\n[ -f \"$PUBLIC_DIR/index.html\" ] || { echo \"ERROR: public/index.html not found\"; exit 1; }\n\ncd \"$IOS_DIR\"\npod install --repo-update\n\necho \"SUCCESS - All files ready\"\n";
